import React from 'react';
import { ErrorBoundary } from './components/ErrorBoundary';

function App() {
  return (
    <ErrorBoundary>
      <div className="App">
        <header className="App-header">
          <h1>Welcome to React App</h1>
          <p>This app includes error boundary handling.</p>
        </header>
      </div>
    </ErrorBoundary>
  );
}

export default App;
